import hero from "../util/hero.jpg"
import vid from "../util/headache.mp4"

const Home = (props) => {

  function center () {
    const homeDiv = document.getElementById('Home')

    var left = window.innerWidth / 2 - homeDiv.clientWidth / 2 + "px"
    var top = window.innerHeight / 2 - homeDiv.clientWidth / 2 + "px"

    alert(JSON.stringify(homeDiv))

    return {
      marginLeft:"20px"
    }
  }

  return (
    <div className="Home-container">
      <div className="Home">
        <div className="Home-left">
          <img src={hero} alt="hero image"/>
        </div>
        <div className="Home-right">
          <h2>Cosmic Darlings</h2>
          <p>Cosmic Darlings are a carefully curated collection of 10,000 robots on the Ethereum blockchain. Each Darling is unique and consists of both hand-drawn and real world traits.</p>
        </div>
      </div>
      <video autoPlay loop muted
      style={{
        // position: "absolute",
        width: "100%",
        left: "50%",
        height: "100%",
        objectFit: "cover",
        transform: "translate(-50%, -50%)",
        zIndex: "-2"
      }}
      >
        <source src={vid} type="video/mp4"/>
      </video>
    </div>
  );
};

export default Home;
